import React from 'react';
import Menu from './Menu';
import Logo from './Logo';

class Header extends React.Component {

  constructor(props)
	{
		super(props);
		this.state = {
			login: this.props.login
		}
	}

  render() {
    return (
      <div className="Header">
          <Logo />
          <Menu login={this.props.login} />
      </div>
    )
  }
}

export default Header;
